FROM 'https://blobs.duckdb.org/data/services-2023.parquet'
LIMIT 3;

SELECT *
FROM 'https://huggingface.co/datasets/blog_authorship_corpus/resolve/refs%2Fconvert%2Fparquet/blog_authorship_corpus/train/0000.parquet'
LIMIT 1;
